import * as OrderManagementLabel from "../../../components/Json/OrderManagementLabel.json"
import ReactDOM from 'react-dom';
// 引入按鈕
import { ClickMe } from "../../../components/ReactElement/ColorBtn";
import { LongColorBtn } from "../../../components/ReactElement/ColorBtn"
// 引入函式
import { UnfoldTd } from "../../../components/ReactElement/OriginalLabel/LabelFunction"

export function ChangeWorld() {
  // ================監控區==================
  let DataTitle = ["排序", "訂單狀態", "訂單成立時間", "取餐時間", "訂單編號", "主機名稱", "金額", "訂購人", "操作"];
  let context = document.getElementsByClassName("context")[0];
  let LabelTitleText = document.getElementsByClassName("LabelTitleText");
  let clickMeSpan0 = document.getElementsByClassName("clickMeSpan0");
  let clickMeText0 = document.getElementsByClassName("clickMeText0");
  let clickMeText8 = document.getElementsByClassName("clickMeText8");
  let ChildTd1 = document.getElementsByClassName("ChildTd1");
  let ChildTd2 = document.getElementsByClassName("ChildTd2");
  let ChildTd3 = document.getElementsByClassName("ChildTd3");
  let ChildTd4 = document.getElementsByClassName("ChildTd4");
  let ChildTd5 = document.getElementsByClassName("ChildTd5");
  let ChildTd6 = document.getElementsByClassName("ChildTd6");
  let ChildTd7 = document.getElementsByClassName("ChildTd7");
  let ChildGroupTitle3 = document.getElementsByClassName("ChildGroupTitle3");
  let ChildGroupTitle4 = document.getElementsByClassName("ChildGroupTitle4");
  let ChildGroupTitle5 = document.getElementsByClassName("ChildGroupTitle5");
  let ChildGroupTitle6 = document.getElementsByClassName("ChildGroupTitle6");
  let ChildGroupTitle7 = document.getElementsByClassName("ChildGroupTitle7");
  let ChildGroupTitle8 = document.getElementsByClassName("ChildGroupTitle8");
  let ChildGroupContent3 = document.getElementsByClassName("ChildGroupContent3");
  let ChildGroupContent4 = document.getElementsByClassName("ChildGroupContent4");
  let ChildGroupContent5 = document.getElementsByClassName("ChildGroupContent5");
  let ChildGroupContent6 = document.getElementsByClassName("ChildGroupContent6");
  let ChildGroupContent7 = document.getElementsByClassName("ChildGroupContent7");
  let ChildGroupContent8 = document.getElementsByClassName("ChildGroupContent8");
  let flexDiv = document.getElementsByClassName("flexDiv");
  let iunputCombo = document.getElementsByClassName("iunputCombo");

  if (
    window.location.href.split("http://localhost:3500/")[1].split("/")[0] === "OrderManagement") {
    // ================Label頁面微調CSS=======================
    if (localStorage.MaxPageValue === undefined) {
      localStorage.setItem("MaxPageValue", 10, 60000)
    }
    context.style.paddingBottom = "20px";
    for (let x = 0; x < flexDiv.length; x++) {
      flexDiv[x].className = "flexDiv flexDivAll";
    }
    flexDiv[3].className = "flexDiv flexDivOrderManagement";
    iunputCombo[1].className = "iunputCombo iunputComboOrderManagement"

    // 表單標題文字引入
    for (let x = 0; x < DataTitle.length; x++) {
      LabelTitleText[x].textContent = DataTitle[x];
    }


    //表單欄位內容引入
    for (let i = 0; i < localStorage.MaxPageValue; i++) {
      clickMeText0[i].textContent = OrderManagementLabel.DataCompent[i]["Index"];
      ChildTd1[i].textContent = OrderManagementLabel.DataCompent[i]["State"];
      ChildTd2[i].textContent = OrderManagementLabel.DataCompent[i]["CreateDate"];
      ChildTd3[i].textContent = OrderManagementLabel.DataCompent[i]["Date"];
      ChildTd4[i].textContent = OrderManagementLabel.DataCompent[i]["Number"];
      ChildTd5[i].textContent = OrderManagementLabel.DataCompent[i]["Store"];
      ChildTd6[i].textContent = OrderManagementLabel.DataCompent[i]["Amount"];
      ChildTd7[i].textContent = OrderManagementLabel.DataCompent[i]["Buyer"];
      ChildGroupTitle3[i].textContent = DataTitle[3];
      ChildGroupTitle4[i].textContent = DataTitle[4];
      ChildGroupTitle5[i].textContent = DataTitle[5];
      ChildGroupTitle6[i].textContent = DataTitle[6];
      ChildGroupTitle7[i].textContent = DataTitle[7];
      ChildGroupTitle8[i].textContent = DataTitle[8];
      ChildGroupContent3[i].textContent = OrderManagementLabel.DataCompent[i]["Date"];
      ChildGroupContent4[i].textContent = OrderManagementLabel.DataCompent[i]["Number"];
      ChildGroupContent5[i].textContent = OrderManagementLabel.DataCompent[i]["Store"];
      ChildGroupContent6[i].textContent = OrderManagementLabel.DataCompent[i]["Amount"];
      ChildGroupContent7[i].textContent = OrderManagementLabel.DataCompent[i]["Buyer"];
      ReactDOM.render(<ClickMe onClick={() => { UnfoldTd(i) }} />, clickMeSpan0[i]);  
      ReactDOM.render(<LongColorBtn text="訂單明細" backgroundColor="#1985AC"/>, clickMeText8[i]);
      ReactDOM.render(<LongColorBtn text="訂單明細" backgroundColor="#1985AC" onClick={() => { }} />, ChildGroupContent8[i]);
    }
  }
}
